import "./SideBar.css";


const SideBar = () => {
  return (
    <div className="side-bar">
      <div className="pfp-container">
        <img src="pfp.png" className="pfp-image"/>
        <p className="pfp-name">Sara Doe</p>
        <a>saradoe@gmail.com</a>
      </div>

    </div>
  );
};

export default SideBar;
